import React from 'react';
import List from './List';
import STORE from './store';

function App(store) { 
  let cardList = [];
  for (let i =0; i < store.lists.length; i++) {
  cardList += store.lists[i].cardIds.forEach(item => store.allCards.id);
  }
  const listList = store.map(list =>
    <List key={list.id} header={list.header} cards={cardList} />);
  return (
    <main className='App'>
      <header class="App-header">
        <h1>Trelloyes!</h1>
      </header>
      <div class="App-list">
        {{listList}}
      </div>
    </main>
  );
}

export default App;
